        return new Source("{% extends 'base.html.twig' %}

{% block title %}Usuario index{% endblock %}

{% block body %}
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>Nombre</th>
                <th>Perfil</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for usuario in usuarios %}
            <tr>
                <td>{{ usuario.id }}</td>
                <td>{{ usuario.email }}</td>
                <td>{{ usuario.roles ? usuario.roles|json_encode : '' }}</td>
                <td>{{ usuario.password }}</td>
                <td>{{ usuario.nombre }}</td>
                <td>{{ usuario.perfil }}</td>
                <td>
                    <a href=\"{{ path('app_admin_usuario_show', {'id': usuario.id}) }}\">show</a>
                    <a href=\"{{ path('app_admin_usuario_edit', {'id': usuario.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_admin_usuario_new') }}\">Create new</a>
{% endblock %}
